fn insert(setvec: &mut HashSet<TinyVec<[i32; 24]>>, factors: &[u32], singles: &[usize], multiples: Vec<Vec<usize>>, multiples_flat: &[usize]) {
    if singles.len() > 0 && factors[singles[0]] == 2 {
        return;
    }
    let bprint = false;
    //let bprint = factors == [2, 2, 3, 5];
    let mut binsert = true;
    for i in 0..singles.len() {
        for j in i+1..singles.len() {
            if factors[singles[i]] == factors[singles[j]] {
                if bprint { println!("factors[{}] == factors[{}] ({} == {})", singles[i], singles[j], factors[singles[i]], factors[singles[j]]); }
                binsert = false;
                break;
            }
        }
        if !binsert {
            break;
        }
    }
    if binsert
    {
        for i in 0..multiples.len() {
            for j in i+1..multiples.len() {
                let smaller;
                let larger;
                if multiples[i].len() <= multiples[j].len() {
                    smaller = i;
                    larger = j;
                } else {
                    smaller = j;
                    larger = i;
                }
                let mut icount = 0;
                let mut matched = HashSet::new();
                for s in &multiples[smaller] {
                    for l in &multiples[larger] {
                        if factors[*s] == factors[*l] && !matched.contains(l) {
                            matched.insert(l);
                            break;
                        }
                    }
                }
                if matched.len() == multiples[smaller].len() {
                    binsert = false;
                    break;
                }
            }
            if !binsert {
                break;
            }
        }
    }
    if binsert {
        for i in multiples_flat {
            for j in singles {
                if factors[*i] == factors[*j] {
                    if bprint { println!("factors[{}] == factors[{}] ({} == {})", *i, *j, factors[*i], factors[*j]); }
                    binsert = false;
                    break;
                }
            }
            if !binsert {
                break;
            }
        }
    }
    if bprint { 
        let single_factors: Vec<u32> = singles.iter().map(|&i| factors[i]).collect();
        let mut multiple_factors: Vec<Vec<u32>> = Vec::new();
        for ary in &multiples {
            multiple_factors.push(ary.iter().map(|&i| factors[i]).collect());
        }
        println!("factors = {:?}, binsert = {}", factors, binsert); 
        println!("singles = {:?}, multiples = {:?}", single_factors, multiple_factors);
    }
    if binsert {
        //let mut vec: Vec<u32> = Vec::new();
		let mut vec: TinyVec<[i32; 24]> = TinyVec::new();
        for i in singles {
            vec.push(factors[*i] as i32);
        }
        for m in multiples {
            let mut iproduct = factors[m[0]];
            for i in 1..m.len() {
                iproduct *= factors[m[i]];
            }
            if vec.iter().find(|&x| *x == iproduct as i32).is_none() {
                vec.push(iproduct as i32);
            } else {
                binsert = false;
                break;
            }
        }
        if bprint { println!("factors = {:?}, binsert = {}, vec = {:?}", factors, binsert, vec); }
        if binsert {
            vec.sort();
            if bprint { println!("vec = {:?}", vec); }
            setvec.insert(vec);
        }
    }
}

