fn insert2(setvec: &mut HashSet<TinyVec<[i32; 24]>>, singles: &[u32], multiples: Vec<Vec<u32>>, multiples_flat: &[u32]) {
    if singles.len() > 0 && singles[0] == 2 {
        return;
    }
    let bprint = false;
    let mut binsert = true;
    for i in 0..singles.len() {
        for j in i+1..singles.len() {
            if singles[i] == singles[j] {
                if bprint { println!("singles[{}] == singles[{}] ({} == {})", i, j, singles[i], singles[j]); }
                binsert = false;
                break;
            }
        }
        if !binsert {
            break;
        }
    }
    if binsert
    {
        for i in 0..multiples.len() {
            for j in i+1..multiples.len() {
                let smaller;
                let larger;
                if multiples[i].len() <= multiples[j].len() {
                    smaller = i;
                    larger = j;
                } else {
                    smaller = j;
                    larger = i;
                }
                let mut icount = 0;
                let mut matched: Vec<usize> = Vec::new();
                for sml in 0..multiples[smaller].len() {
                    for lrg in 0..multiples[larger].len() {
                        if multiples[smaller][sml] == multiples[larger][lrg] && matched.iter().find(|&x| *x == lrg).is_none() {
                            matched.push(lrg);
                            break;
                        }
                    }
                }
                if matched.len() == multiples[smaller].len() {
                    binsert = false;
                    break;
                }
            }
            if !binsert {
                break;
            }
        }
    }
    if binsert {
        for i in multiples_flat {
            for j in singles {
                if *i == *j {
                    if bprint { println!("multiples_flat[{}] == singles[{}] ({} == {})", multiples_flat.iter().position(|&x| x == *i).unwrap(), singles.iter().position(|&x| x == *j).unwrap(), *i, *j); }
                    binsert = false;
                    break;
                }
            }
            if !binsert {
                break;
            }
        }
    }
    if bprint { 
        println!("singles = {:?}, multiples = {:?}, binsert = {}", singles, multiples, binsert);
    }
    if binsert {
        //let mut vec: Vec<u32> = singles.to_vec();
		let mut vec: TinyVec<[i32; 24]> = TinyVec::new();
		for s in singles {
			vec.push(*s as i32);
		}
        for m in &multiples {
            let mut iproduct = m[0];
            for i in 1..m.len() {
                iproduct *= m[i];
            }
            if vec.iter().find(|&x| *x == iproduct as i32).is_none() {
                vec.push(iproduct as i32);
            } else {
                binsert = false;
                break;
            }
        }
        if bprint { println!("singles = {:?}, multiples = {:?}, binsert = {}, vec = {:?}", singles, multiples, binsert, vec); }
        if binsert {
            vec.sort();
            if bprint { println!("vec = {:?}", vec); }
            setvec.insert(vec);
        }
    }
}

